import React, { useLayoutEffect, useEffect, useState } from "react";
import {
  View,
  Text,
  Button,
  Image,
  Dimensions,
  TouchableOpacity,
} from "react-native";
import axios from "axios";
import {
  Con,
  Card,
  SafeCon,
  ListCard,
  ShopDes,
  ShopTitle,
  ReservBtn,
} from "../assets/common/common";
import { SafeAreaView } from "react-native-safe-area-context";
import Icon from "react-native-vector-icons/FontAwesome";
import styled, { withTheme } from "styled-components/native";
import { Rating, AirbnbRating } from "react-native-ratings";
import { createStackNavigator } from "@react-navigation/stack";

const Home = ({ navigation }) => {
  const Stack = createStackNavigator();
  const [photoShops, setPhotoShops] = useState();

  const showShopDetail = (seq) => {
    alert(seq);
  };

  useEffect(() => {
    axios({
      method: "get",
      url: "http://172.30.1.25:4001/getPhotoShop",
      responseType: "json",
    })
      .then(({ data, status }) => {
        if (status == 200) setPhotoShops(data);
      })
      .catch((res) => {
        console.log(res);
      });
  }, []);

  const photoShopList = () => {
    return (
      <View style={{ backgroundColor: "red" }}>
        <Text>zz</Text>
      </View>
    );
  };

  return (
    <SafeCon>
      <Stack.Navigator initialRouteName="List">
        <Stack.Screen name="List" component={photoShopList} />
      </Stack.Navigator>
    </SafeCon>
  );
};

export default Home;
